```cpp
#include <iostream>
#include <fstream>
#include <string>
#include <sstream>

int countOccurrences(const std::string& line, const std::string& word) {
    std::istringstream ss(line);
    std::string token;
    int count = 0;

    while (ss >> token) {
        if (word == token) {
            count++;
        }
    }

    return count;
}

int main() {
    std::string filename;
    std::string word;

    std::cout << "Enter the filename: ";
    std::cin >> filename;
    std::cout << "Enter the word to count: ";
    std::cin >> word;

